import React from "react";

export const Taille = props => {
  return (
    <li>
      <img
        src="./img/nav/3.png"
        alt="ok"
        className="w-20 h-20 flex justify-content-center z-1  items-center mx-auto"
      />
      {/* <div className="rounded-full h-20 w-20 z-2  bg-red-900"></div> CIRCLE*/}
      <div className="flex mx-auto items-center">
        <span className="h-10 w-10 bg-yellow-500 px-4 py-2 mx-2 text-white">
          {props.imgNav === 1 ? 1 : 2}
        </span>
        <h2>Taille</h2>
      </div>
      <div className="">
        <ul>
          <li>
            <img
              src="./img/sizeTacos/sizeTacos.png"
              alt="ok"
              className="w-20 h-20 flex justify-content-center z-1  items-center mx-auto"
            />
            <input type="radio" name="tacos" id="" />
            <label>4 Viandes</label>
          </li>
        </ul>
      </div>
    </li>
  );
};

export const Viandes = () => {
  return (
    <li>
      <img
        src="./img/nav/4.png"
        alt="ok"
        className="w-30 h-20 flex justify-content-center items-center mx-auto"
      />
      <div className="flex mx-auto items-center">
        <span className="h-10 w-1 bg-blue-500 px-4 py-2 mx-2 text-white">
          2
        </span>
        <h2>Viandes</h2>
      </div>
    </li>
  );
};

export const Sauces = () => {
  return (
    <li>
      <img
        src="./img/nav/2.png"
        alt="ok"
        className="w-25 h-20 flex justify-content-center items-center mx-auto"
      />
      <div className="flex mx-auto items-center">
        <span className="h-10 w-10 bg-red-500 px-4 py-2 mx-2 text-white">
          3
        </span>
        <h2>Sauces</h2>
      </div>
    </li>
  );
};

export const Extra = () => {
  return (
    <li>
      <img
        src="./img/nav/1.png"
        alt="ok"
        className="w-20 h-20 flex justify-content-center items-center mx-auto"
      />
      <div className="flex mx-auto items-center">
        <span className="h-10 w-10 bg-green-800 px-4 py-2 mx-2 text-white">
          4
        </span>
        <h2>EXTRA</h2>
      </div>
    </li>
  );
};
